The Shins are an indie rock group consisting of singer and guitarist James Mercer, keyboardist/guitarist/bassist Martin Crandall, bassist/guitarist Dave Hernandez, and drummer Jesse Sandoval. They formed in 1997, in Albuquerque, New Mexico, as a side project of Mercer (previously of Blue Roof Dinner) and Sandoval, who were both members of the lo-fi musical group Flake Music (formed as Flake 1992). The band was signed to Sub Pop following a successful tour in 2000 with fellow college-rockers Modest Mouse.

